/**
 * @param {string} dominoes
 * @return {string}
 */
var pushDominoes = function(dominoes) {
 
    var result = dominoes;
    var _result = "";
    var len = dominoes.length;
    while(true){
        _result = "";
        for(let i=0;i<len;i++){
            if(i==0){
                if(result[i] == "."){
                    if(result[i+1] == "L"){
                        _result += "L";
                    }else{
                        _result += ".";
                    }
                }else{
                    _result += result[i];
                }
                continue;
            }
            if(i==len-1){
                if(result[i] == "."){
                    if(result[i-1] == "R"){
                        _result += "R";
                    }else{
                        _result += ".";
                    }
                }else{
                    _result += result[i];
                }
                continue;
            }

            if(result[i] == "."){
                if(result[i-1] == "R" && result[i+1] != "L"){
                    _result += "R";
                    continue;
                }
                if(result[i-1] != "R" && result[i+1] == "L"){
                    _result += "L";
                    continue;
                }else{
                    _result += ".";
                }
            }else{
                _result += result[i];
            }
        }
        if(_result == result){
            break;
        }
        result = _result;
    }
    return result;
};

